import React from "react";

const MovieListCard = (props) => {
  props.forEach((movie) => {});
  return (
    <>
      {props.movies.map((movie, index) => (
        <div>
          <img src={`${IMG_URL + poster_path}`} alt="movie=poster"></img>
        </div>
      ))}
    </>
  );
};

export default MovieListCard;
